For instance, often these models have data that needs to be shown onscreen to update the ui.  The fields are simple there -- whoa, available!  So much easier than Java -- to iterate through:

<code class="javascript">
for (field in obj) { /* ... */ }
</code>

Once we can iterate through the fields, then we can throw them out onto the page.  One way that I like to do this is by careful naming of page elements to correspond to field names in the object.  

So, here's a full-length demo (using jquery):

<code class="javascript">

var pojso = {
  id: 3,
  name: 'Call me Ishmael!'
};

function updateUI(obj) {
  for (field in obj) {
    $('#ui-' + field).html(obj[field]);
  }
}

// normally, put this in an event handler
updateUI(pojso);
</code>

<code class="html">
<!-- the islands to be updated -->

<div id="ui-id"></div>
<div id="ui-name"></div>

</code>

Now can I have my Christmas anagrams and go home?

<h3>Update</h3>
Now, while this post is still young and tender, I want to make a final point of recording how to execute a function within an object.  Let's say that pojso became a little less plain and simple:

<code class="javascript">
var nijso = {
  id: 3,
  name: 'New and improved',
  action: function () { 
    alert('Souit action!');
  }
}
</code>

Now, in order to execute the new action function with the name (this would probably come in handy if you only had the name in some sort of programmatic instance, like executing all/a set of functions on the object in a loop, try this:

<code class="javascript">
nijso['action'](); // this would get you an alert
</code>

As a part of a recent hack, I wanted to remove a certain element from a list.  As I was iterating over the list, I tried to find an object that met a certain criteria and then remove it, as follows:

<code class="java">
void removeStuff() {
   List<Recipient> list = service.populateList();
   for (Recipient r : list) {
      if (r.getProperty().equals(searchProperty)) {
         list.remove(r);
      }
   }
}
</code>

Unfortunately, this will throw the ConcurrentModificationException.  From the said Exception's JavaDoc:

"Note that this exception does not always indicate that an object has been concurrently modified by a different thread. If a single thread issues a sequence of method invocations that violates the contract of an object, the object may throw this exception. For example, if a thread modifies a collection directly while it is iterating over the collection with a fail-fast iterator, the iterator will thow this exception."

Perfect.  That too-aptly describes my miserable attempts.  So, it sounds like I just have to wait until iteration is complete to then attempt modification.  So, a quick fix might look something like this:

<code class="java">
void removeStuff() {
   List<Recipient> list = service.populateList();
   Recipient toRemove = null;
   for (Recipient r : list) {
      if (r.getProperty().equals(searchProperty)) {
         toRemove = r;
      }
   }
   list.remove(toRemove);
}
</code>

Interestingly, and it was true in this case, the JavaDoc also states: "ConcurrentModificationException  should be used only to detect bugs."

<h4>Update</h4>

My friend, Steve, found a better way to do this inline w/o the exception that employs a manual iterator:
<code class="java">
Beaner beaner = null;
Iterator iter = list.iterator();
while (iter.hasNext()){
   beaner = (Beaner) iter.next();
   if (beaner.getType() == 3){
       iter.remove();
   }
}
</code>

