I was trying to do something like this:

<code class="java">
public class Service {
   @PersistenceContext
   private EntityManager em;

   public List<Object[]> search(String sortProperty) {
      Query q = em.createNativeQuery("select col from table order by :sortProperty");
      q.setParameter("sortProperty", sortProperty);
      return q.getResultList();   
   }
}
</code>

This will yield something awesome, like this:
<code class="java">
java.sql.SQLException: ORA-01745: invalid host/bind variable name
</code>

Seriously, the only way I've found around this is append, similar to this:
<code class="java">
/* ... */
Query q = em.createNativeQuery("select col from table order by " + sortProperty);
/* ... */
</code>

Just make sure you've got something scrubbing the data coming in.

Any better suggestions?

The object-relational mapping world of JPA and Hibernate has made a lot of things really nice and easy.  As with any framework of this sort, however, it becomes frustrating when the pieces that are supposed to provide magic ease of development do not work as expected.  The frustration is only exacerbated when the docs are skimpy.

Type conversions usually happen automatically in JPA, but possibly due to some databases incredibly not having implemented boolean fields yet (Oracle and pre-5.0 MySQL), an extra bit of help in conversion is needed.

The mechanism for showing that a conversion will need to be manually specified is this annotation:

<code class="java">
@Type(type="[type here]")
private Boolean active;
</code>

In your database, if you store your boolean values as 'Y' or 'N', then you will want to use this:

<code class="java">
@Type(type="yes_no")
private Boolean active;
</code>

In your database, if you store your boolean values as '1' or '0', then you will want to use this:

<code class="java">
@Type(type="boolean")
private Boolean active;
</code>

In your database, if you store your boolean values as 'T or 'F', then you will want to use this:

<code class="java">
@Type(type="true_false")
private Boolean active;
</code>

Note that these solutions are Hibernate-dependent, and not sticking with the general standard of JPA.  Too bad JPA doesn't provide something like this (as of now, anyway)!

After much searching, I found this <a href="http://www.hibernate.org/hib_docs/reference/en/html/mapping-types.html">doc</a> that you may find useful.

If you want a Java logic-specific (but more portable) solution, you could try this:

<code class="java">

@Basic
private Character active;

public Boolean getActive() {
    if (active == null) return null;
    return active == 'Y' ? Boolean.TRUE : Boolean.FALSE;
}

public void setActive(Boolean active) {
    if (active == null) {
      this.active = null;
    } else {
      this.active = active == true ? 'Y' : 'N';
    }
}

</code>

This code:
<code class="java">
@Test(groups = {"unit"})
public void testJunk() throws NoSuchMethodException {
	Method m = MyBean.class.getDeclaredMethod("test", Boolean.TYPE, Integer.TYPE, Integer.class);
	MyBean bean = createMock(MyBean.class, m);
	
}
</code>

will be able to find the method here:
<code class="java">
void test(boolean junk, int prim, Integer cl) {
	System.out.println("blast");
}
</code>

Notice, that object params use: Integer.class

Primitive params use: Integer.TYPE

The one other thing that bugs me with this reflection bit is the string representation of the test() method name.  So, when the test() method name changes to test2(), the unit test will break.  Blast!  Hence, the standard out message.

What a journey of discovery!  I haven't done much many-to-many relationship management in JSF.  Django makes it quite easy.  But at work recently, I did it in JSF.  It was quite the experience, hereafter chronicled.

To the unseen challenges of this task, I was caught unawares.  Who would have thought that a select-many gui component would be so bothersome?  But, now that the first in JSF has been done, the rest will be more straightforward...

My task was to maintain a person<->citizenship many-to-many relationship.  After a couple funny exchanges with our designers over multiple dropdowns (selectOneMenu's), hehe, the design was switched to one dropdown, one select multiple list (hidden), and a list of (nicer-looking) text to represent the selection.

<a href="http://picasaweb.google.com/lh/photo/N707BgyvgcUm1uxzGq1G1w"><img src="http://lh6.ggpht.com/trent.jake/SNf6P_v3CRI/AAAAAAAAENk/TPIYGn4KCpA/s800/selectmany.png" /></a>

Without going into too much detail on the pitfalls that I found myself stumbling into, I'll give the final solution (for me) here:

<h3>The JSF:</h3>

<pre>
<code class="jsp">
<dl>
    <dt>Citizenship</dt>
    <dd>
        <h:selectOneMenu styleClass="citz-choice" converter="#{entityConverter}">
            <f:selectItems value="#{r:convertSelectItemList(personDetailsBean.countries)}" />
        </h:selectOneMenu>
        <a class="add-link-icon add-citz-btn" href="#" style="text-decoration:none;">&#160;</a>
        <br />
        <h:selectManyListbox styleClass="citz-list" value="#{personDetailsBean.person.personCitizenshipList}"
            converter="#{entityConverter}" style="display:none;" >
            <f:selectItems value="#{r:convertSelectItemList(personDetailsBean.countries)}" />
        </h:selectManyListbox>
        <div class="citzs">
            <ui:repeat var="citz" value="#{personDetailsBean.person.personCitizenshipList}">
                <a id="cit_#{citz.entityConverterString}" class="delete-link-icon" href="javascript:removeCitz('#{citz.entityConverterString}');">#{citz.longName}</a>
            </ui:repeat>
        </div>
    </dd>
</dl>
</code></pre>

<strong>Things to note:</strong>
<ul>
<li>The comprehensive country list is in both the selectOneMenu and the selectManyListbox.  I made a big mistake in trying to copy options from the selectOneMenu on an html menu, with just having select items in the selectManyListbox specific to the person like so:
<code class="jsp">
<f:selectItems value="#{r:convertSelectItemList(personDetailsBean.person.personCitizenshipList)}" />
</code>
, but that did not work!</li>
<li>r:convertSelectItemList is a custom JSF method for converting pojo's into SelectItem object lists.  The important thing is that this f:selectItems component is fed with a collection of SelectItem's.</li>
<li>I'm not showing the selectManyListbox.  It could be that you want to and could thus cut out the whole "nice" display in &lt;div class="citzs"&gt;.</li>
<li>#{entityConverter} is specific to our development shop.  The most important thing is that the mechanism that renders the select items must render the values the same in the selectOneMenu and the selectManyListBox.</li>
</ul>

<h3>The Javascript:</h3>
<code class="javascript">
jQuery(document).ready(function() {
            jQuery(".add-citz-btn").click(function() {
                jQuery(".citz-choice").copyOptions(".citz-list");
                jQuery(".citzs").append(genCountrySelection());
            });
        });

        function genCountrySelection() {
            var val = jQuery(".citz-choice").selectedValues();
            var label = jQuery(".citz-choice").children("[@selected]").text();
            return "&lt;a id=\"cit_" + val + "\" class=\"delete-link-icon\" href=\"javascript:removeCitz('" + val + "');\"&gt;" + label + "&lt;/a&gt;";
        }

        function removeCitz(poldiv) {
            jQuery("[@id=cit_" + poldiv + "]").remove();
            jQuery(".citz-list").deselectOptions(poldiv);
        }
});
</code>

<strong>Things to note:</strong>
<ul>
<li>I used <a href="http://jquery.com/">jquery</a> and the <a href="http://www.texotela.co.uk/code/jquery/select/">jquery.selectboxes.js</a> plugin.  I added the deselectOptions() function to the .js file (shown below).</li>
<li>I used a <a href="http://aprilandjake.com/tech/article/12">jsf-safe id selector</a>.</li>
</ul>

<h3>deselectOptions() Function Addition:</h3>
<code class="javascript">
/**
 * Deselect given value(s)
 * @author jtsnake, based on selectValues() above
 */
$.fn.deselectOptions = function(value)
{
	var v = value;
	var vT = typeof(value);
	// has to be a string or regular expression (object in IE, function in Firefox)
	if(vT != "string" && vT != "function" && vT != "object") return this;
	this.each(
		function()
		{
			if(this.nodeName.toLowerCase() != "select") return this;
			// get options
			var o = this.options;
			// get number of options
			var oL = o.length;
			for(var i = 0; i < oL; i++)
			{
				if(v.constructor == RegExp)
				{
					if(o[i].value.match(v))
					{
						o[i].selected = false;
					}
				}
				else
				{
					if(o[i].value == v)
					{
						o[i].selected = false;
					}
				}
			}
		}
	);
	return this;
};
</code>

<h3>Java Models:</h3>
<code class="java">

// Person.java
/* ... */
@ManyToMany
@JoinTable(name="person_citizenship",
           joinColumns=@JoinColumn(name="person_id"),
           inverseJoinColumns=@JoinColumn(name="country_id"))
private List < PoliticalDivision > personCitizenshipList;
/* ... */

// PoliticalDivision.java
/* ... */
public String getEntityConverterString() {
    return this.toString().split("@")[0] + ":" + id;
}
/* ... */

</code>

<strong>Things to note:</strong>
<ul>
<li>"The stack" is a set of technologies specific to our development shop.  You probably won't have to handle this stuff in your implementation.  The thing to remember is that the values in the selectOneMenu must match those in the selectManyListBox.  This is a facilitator of that in our environment.</li>
</ul>

As with any solution to a problem, there are likely many other options.  I would be very interested to see what other people have come up with!  Please post links if you have them.

As a part of the same voting mechanism that I wrote about for <a href="http://aprilandjake.com/content/pass-parameters-jquery-event-functions/">this article on event handler parameter passing</a>, I wanted to keep id and (vote) direction around for the callback, which was to update the UI.  

First, I made an ajax call with jquery to make vote updates to the database, and on my way to the ajax call, I would save the id and direction in a global (bad) variable.  This works, because later, I can reference it in my callback function, updateUI:  

<code class="javascript">
var action = null;
var objectid = null;

function vote(id, direction) {
   action = direction;
   objectid = id;
   $.ajax({
     type: 'POST',
     url: '/hymn/' + id + '/vote/' + direction + '/',
     dataType: 'json',
     async: false,
     timeout: 15000,
     success: updateUI
   });
}
</code>

The next solution is a bit cleaner and makes us feel better about ourself.  Instead of the global, a closure is used, in which we decorate the response object with new state (id and direction); and since the response object is passed by default into the ajax callback function, it's available later by calling response.id or response.objectid:

<code class="javascript">
function vote(id, direction) {
   $.ajax({
     type: 'POST',
     url: '/hymn/' + id + '/vote/' + direction + '/',
     dataType: 'json',
     async: false,
     timeout: 15000,
     success: function (response) {
           response.action = direction
           response.objectid = id
           updateUI(response);
        }
   });
}
</code>

Sweet!

The need to pass parameters is made clear when you have a callback that functions differently depending on what particular element triggers the event.  For example,  I'm doing a simple voting mechanism for every item in a list.  When an up or down arrow in front of the item is pressed, I want to make an ajax call that will record the vote on the server and then update the UI.  Therefore, I need to know what item I'm recording the vote for.  In the code below, the id will tell me what row I'm on.  This is the most important part.  The second parameter is the direction of the vote (up or down).  This is less important, in this case, because the same thing could have been accomplished by creating a separate callback for up and down.

<code class="javascript">
$(document).ready(function() {
   $(".voter-up,.voter-down").click(function() {
     var id = parseInt($(this).attr("id").substring(12));
     var direction = $(this).attr("class").substring(6);
     vote(id, direction);
   });
});
</code>

So what's the key?  Embed the data that you want in id, class, or just any attribute of any element that has a per-item/row presence.  That explains the substring() calls.  My attributes look like this:

<code class="html">
<a class="voter-up" id="link-hymn-u-{{ h.id }}" href="#">...something...</a>
</code>

The {{ curlies }} are for django templates, which are awesome, btw.

I'm no regex guru, so I split this into 4 separate pieces:

<code class="javascript">
// remove newline / carriage return
str.replace(/\n/g, "");

// remove whitespace (space and tabs) before tags
str.replace(/[\t ]+\</g, "<");

// remove whitespace between tags
str.replace(/\>[\t ]+\</g, "><");

// remove whitespace after tags
str.replace(/\>[\t ]+$/g, ">");
</code>

Return the replacement string and set it to the value you want to save.  I wanted to use jQuery, so here's the final product:

<code class="javascript">
$("#copy-txt").val(
  $("#nn-results").html().replace(/\n/g, "")
    .replace(/[\t ]+\</g, "<")
    .replace(/\>[\t ]+\</g, "><")
    .replace(/\>[\t ]+$/g, ">")
);
</code>

I have a containing div with the id "nn-results", grab it's inner html, do the replacements on that html, and then set the id="copy-txt" input element value to be the results.  I have seen some posts where people tried to make all that replacement happen in one regex, but I wasn't good enough with the regex/js combo to make it work.  If someone is ready to go pro, and it isn't easy, please comment below.

