Unexpected call to method or property access

The usefulness of this error message led me to Google, where I soon found the many people had experienced this same awfulness on IE for a multiplicity of reasons, most wide-spread among them being appending children to elements that didn't exist and trying to remove elements from the head.  Neither of these scenarios seemed applicable, so being stuck without Firebug on the offending "browser", I devo'd back to the good 'ol alert box debugging.  I soon happened upon this method:

<code class="javascript">
function (data, prefix) {
  for (field in data) {
      $(prefix + field).html(data[field]).val(data[field]);
  }
}
</code>

It turns out that the elements that I'm selecting with the selector "prefix + field", gave me both input tags and other html elements.  This is why I do an update to the content with html() and with val().  This works in Firefox and Chrome.  But, on IE, it fails without pretense of working at all.  Eventually, I found that if I did an html() update on the html tags, and a val() update on inputs, it would work.  In this light, the error message actually makes a little sense.  Rewritten, it might say, "Hey naive web developer, you are trying to set an attribute that is not there.  I'm gonna die.  Bye now."

Rewritten for the express purpose of pleasing IE and to overcome my naivete, here it is:
<code class="javascript">
function (data, prefix) {
  for (field in data) {
      $(prefix + field).each(function () {
          if ($(this).attr('value') != undefined) {
              $(this).val(data[field]);
          } else {
              $(this).html(data[field]);
          }
      });
  }
}
</code>

In our application, we use a jsf converter that converts the string representation of the a jpa-managed object into the object proper.  

The required format of this string is thus:

<code>
fully.qualified.class.name:primarykey
</code>

I don't want to override the toString() method because we use it for other things.  And, I don't want to have to create some method to return this formatted string to me in <strong>every</strong> class that I might want to call this on.  So, I created a util method to do this for me.

<code class="java">
public static String getEntityConverterString(Object o) {
   String retval = null;
   if (o != null) {
      String id = null;
      for (Field f : o.getClass().getDeclaredFields()) {
      if (f.isAnnotationPresent(Id.class)) {
         String getterName = "get" + StringUtils.capitalize(f.getName());
         for (Method m : o.getClass().getDeclaredMethods()) {
         if (m.getName().equals(getterName)) {
            try {
            Object idObj = m.invoke(o, null);
            if (idObj != null) {
               id = idObj.toString();
               break;
            }
            } catch (IllegalAccessException e) {
            throw new RuntimeException("Cannot find appropriate accessor for @Id field ");
            } catch (InvocationTargetException e) {
            throw new RuntimeException("Exception thrown w/in accessor");
            }
         }
         }
         break;
      }
      }
      retval = o.toString().split("@")[0] + ":" + id;
   }
   return retval;
}
</code>

The only stipulation to this working is that the class follows the JavaBean naming convention standard of "get" + capitalized field name following.  Oh, and one more: this is only designed for @Entity's with one @Id field (no composite key).

This method goes through all fields, finds the one with the javax.persistence.Id interface annotation, then tries to find a matching accessor method.  If it is found, it is executed, the value of the id field is given, finally to be used to create the specially formatted string.
